import React, { useState } from "react";

export default function Signup() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    birthDate: '',
    education: '',
    contact: '',
    email: ''
  });
  const [errors, setErrors] = useState({
    firstName: '',
    lastName: '',
    birthDate: '',
    education: '',
    contact: '',
    email: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name === 'contact') {
      // Ensure only digits are allowed in the contact field
      if (!/^\d*$/.test(value)) {
        setErrors(prevErrors => ({
          ...prevErrors,
          [name]: 'Contact must contain only digits.'
        }));
      } else if (value.length !== 10) {
        setErrors(prevErrors => ({
          ...prevErrors,
          [name]: 'Contact must be a 10-digit number.'
        }));
      } else {
        setErrors(prevErrors => ({
          ...prevErrors,
          [name]: ''
        }));
      }
    }

    if ((name === 'firstName' || name === 'lastName') && /\d/.test(value)) {
      setErrors(prevErrors => ({
        ...prevErrors,
        [name]: 'Name must not contain numbers.'
      }));
    } else {
      setErrors(prevErrors => ({
        ...prevErrors,
        [name]: ''
      }));
    }

    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate form fields
    let valid = true;
    for (const key in formData) {
      if (formData[key].trim() === '') {
        setErrors(prevErrors => ({
          ...prevErrors,
          [key]: `${key.charAt(0).toUpperCase() + key.slice(1)} is required.`
        }));
        valid = false;
      }
    }

    if (valid) {
      console.log("Form submitted:", formData);
      // Reset form data
      setFormData({
        firstName: '',
        lastName: '',
        birthDate: '',
        education: '',
        contact: '',
        email: ''
      });
    }
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <h2 className="text-center mb-4">Student Registration Form</h2>
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label" htmlFor="firstName">First Name:</label>
              <input
                type="text"
                id="firstName"
                name="firstName"
                className="form-control"
                value={formData.firstName}
                onChange={handleChange}
              />
              {errors.firstName && <p className="text-danger">{errors.firstName}</p>}
            </div>
            <div className="mb-3">
              <label className="form-label" htmlFor="lastName">Last Name:</label>
              <input
                type="text"
                id="lastName"
                name="lastName"
                className="form-control"
                value={formData.lastName}
                onChange={handleChange}
              />
              {errors.lastName && <p className="text-danger">{errors.lastName}</p>}
            </div>
            <div className="mb-3">
              <label className="form-label" htmlFor="birthDate">Birth Date:</label>
              <input
                type="date"
                id="birthDate"
                name="birthDate"
                className="form-control"
                value={formData.birthDate}
                onChange={handleChange}
              />
              {errors.birthDate && <p className="text-danger">{errors.birthDate}</p>}
            </div>
            <div className="mb-3">
              <label className="form-label" htmlFor="education">Education:</label>
              <input
                type="text"
                id="education"
                name="education"
                className="form-control"
                value={formData.education}
                onChange={handleChange}
              />
              {errors.education && <p className="text-danger">{errors.education}</p>}
            </div>
            <div className="mb-3">
              <label className="form-label" htmlFor="contact">Contact:</label>
              <input
                type="tel"
                id="contact"
                name="contact"
                className="form-control"
                value={formData.contact}
                onChange={handleChange}
              />
              {errors.contact && <p className="text-danger">{errors.contact}</p>}
            </div>
            <div className="mb-3">
              <label className="form-label" htmlFor="email">Email:</label>
              <input
                type="email"
                id="email"
                name="email"
                className="form-control"
                value={formData.email}
                onChange={handleChange}
              />
              {errors.email && <p className="text-danger">{errors.email}</p>}
            </div>
            <div className="text-center">
              <button type="submit" className="btn btn-primary mr-2">Submit</button>
              <button type="reset" className="btn btn-primary mr-2">Reset</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
